import { useDispatch } from "react-redux";
import { useEffect } from "react";
import { fetchAnalystics } from "./globalStore/actions/analytics";

function App() {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(fetchAnalystics([{ id: 1, name: "User" }]));
  }, []);

  return <div></div>;
}

export default App;
